ehrten Herrn Doct. Christen aufrichtig ertheiltem Attestato zu ersehen ,; das Stuck für <PRIZE>6. Rappen</PRIZE>. Zu jedem Stuck obbemeldter Sachen ist ein nöthiger Bericht beygelegt, von ihrem Gebrauch und Würckung.</ITEM>"
